const styles = {
    main: {
        backgroundColor: "white",
        display: "flex",
        flexDirection: "row",
        width: "300px"
    }
}

function MiniPalette (props) {
    const {classes, id, paletteName, colors} = props;
    // render(){
    //     const {paletteName, colors, id, emoji } = this.props;
        return(
            <div className={classes.main}>
                {/* {props.paletteName} */}
                <Link to = {`/palette/${id}`}>{paletteName}</Link>
                {colors.map(color => (
                    <div>{color.color}</div>
                ))}
            </div>
        )
    // }
